{"cells":[{"source":"<a href=\"https://www.kaggle.com/code/jerodri14/bellabeat-capstone?scriptVersionId=102544104\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown","outputs":[],"execution_count":0},{"cell_type":"markdown","id":"82a69ebc","metadata":{"_kg_hide-output":true,"papermill":{"duration":0.023448,"end_time":"2022-08-04T20:31:16.126123","exception":false,"start_time":"2022-08-04T20:31:16.102675","status":"completed"},"tags":[]},"source":["<h1 style=\"font-family:helvetica;\"> <center> How Can a Wellness Technology Company Play It Smart?</center> </h1>\n","\n","<h2 style><center style=\"color:#CD5C5C; font-family:Helvetica;\">Bellabeat Case Study</center></h2>"]},{"cell_type":"markdown","id":"41483d16","metadata":{"papermill":{"duration":0.020578,"end_time":"2022-08-04T20:31:16.16717","exception":false,"start_time":"2022-08-04T20:31:16.146592","status":"completed"},"tags":[]},"source":["## Table of Contents\n","* [1. Summary](#Summary1)\n","* [2. Ask](#Ask1)\n","* [3. Prepare](#Prepare1)\n","    * [3.1 Data Used](#Prepare2)\n","    * [3.2 Accessibility and privacy of data](#Prepare2)  \n","    * [3.3 Information about the data](#Prepare3)\n","    * [3.4 Data organization and verification](#Prepare4)  \n","    * [3.5 Data Limitations](#Prepare5)\n","*  [4. Process](#Process1)\n","    * [4.1 Installing packages and opening libraries](#Process2)\n","    * [4.2 Importing datasets](#Process3)  \n","    * [4.3 Previewing datasets](#Process4)\n","    * [4.4 Cleaning and Transforming datasets](#Process5)  \n","    * [4.5 Formatting date and time in datasets](#Process6)\n","*  [5. Analyze and Share](#AnalyzeandShare1)\n","    * [5.1 Breaking down of Users using the fitness tracker features](#AnalyzeandShare2)\n","    * [5.2 Usage Groups](#AnalyzeandShare3)\n","    * [5.3 Hourly Analysis](#AnalyzeandShare4)  \n","    * [5.4 Correlations](#AnalyzeandShare5)\n","    * [5.5 Weight ](#AnalyzeandShare6)\n","    * [5.6 Tendency ](#AnalyzeandShare7)\n","*  [6. Act](#Act1)\n","    * [6.1 Discussion on trends](#Act2)\n","    * [6.2 Recommendations](#Act3)\n","\n"]},{"cell_type":"markdown","id":"72934c5f","metadata":{"papermill":{"duration":0.019642,"end_time":"2022-08-04T20:31:16.206464","exception":false,"start_time":"2022-08-04T20:31:16.186822","status":"completed"},"tags":[]},"source":["# 1. Summary <a class=\"anchor\" id=\"Summary1\"></a>\n","\n","Bellebeat is a high-tech manufacturer of health-focused products for women. Bellabeat is a successful small company, but they have the potential to become a larger player in the global smart device market.\n","\n","The goal of this case study is to analyze smart device data from a non-Bellabeat fitness tracker(in this case Fitbit) and gain insight into how consumers are using their smart devices. These insights will then guide marketing strategy for the company based on the recommendations provided at the end of this project.\n","\n","The device I chose to focus on is the Bellbeat Time, which is a wellness watch that combines the timeless look of a classic timepiece with smart technology to track user activity, sleep, and stress. The Time watch connects to the Bellabeat app to provide you with insights into your daily wellness.\n","\n"]},{"cell_type":"markdown","id":"2abd39e9","metadata":{"papermill":{"duration":0.020109,"end_time":"2022-08-04T20:31:16.246564","exception":false,"start_time":"2022-08-04T20:31:16.226455","status":"completed"},"tags":[]},"source":["# 2. Ask <a class=\"anchor\" id=\"Ask1\"></a>\n","#### Busines Task\n","Analyze how people use their smart fitness devices so that Bellabeat can learn and apply these trends to their own customers as well as make data driven decisions so they can apply them to their marketing strategy \n","\n","These questions will guide my analysis:\n","1. What are some trends in smart device usage?\n","2. How could these trends apply to Bellabeat customers?\n","3. How could these trends help influence Bellabeat marketing strategy?"]},{"cell_type":"markdown","id":"fd5628fd","metadata":{"papermill":{"duration":0.020048,"end_time":"2022-08-04T20:31:16.28611","exception":false,"start_time":"2022-08-04T20:31:16.266062","status":"completed"},"tags":[]},"source":["# 3. Prepare <a class=\"anchor\" id=\"Prepare1\"></a>\n","#### 3.1 Data used <a class=\"anchor\" id=\"Prepare2\"></a>\n","FitBit Fitness Tracker Data (CC0: Public Domain, dataset made available through Mobius): This Kaggle data set\n","contains personal fitness tracker from thirty fitbit users. Thirty eligible Fitbit users consented to the submission of\n","personal tracker data, including minute-level output for physical activity, heart rate, and sleep monitoring. It includes\n","information about daily activity, steps, and heart rate that can be used to explore users’ habits.\n","#### 3.2 Accessibilty and privacy of data <a class=\"anchor\" id=\"Prepare3\"></a>\n","This dataset is licensed under the CC0: Public domain license:\n","The person who associated a work with this deed has dedicated the work to the public domain by waiving all of his or her rights to the work worldwide under copyright law, including all related and neighboring rights, to the extent allowed by law.\n","\n","You can copy, modify, distribute and perform the work, even for commercial purposes, all without asking permission.\n","#### 3.3 Information about the data <a class=\"anchor\" id=\"Prepare3\"></a>\n","This dataset generated by respondents to a distributed survey via Amazon Mechanical Turk between 03.12.2016-05.12.2016. Thirty eligible Fitbit users consented to the submission of personal tracker data, including minute-level output for physical activity, heart rate, and sleep monitoring. Individual reports can be parsed by export session ID (column A) or timestamp (column B). Variation between output represents use of different types of Fitbit trackers and individual tracking behaviors / preferences.\n","\n","#### 3.4 Data organization and verification <a class=\"anchor\" id=\"Prepare4\"></a>\n","The dataset is a collection of 18 .csv files. 15 of these files are in long format, since each row is one point per user, and the other 3 are in wide format. Each user has a unique ID and each column represents a variable metric such as calories, sleep records, METs, heartrate, steps, distance etc. The data is further broken down into different timeframes varying for data at the second, minute, hour, and day level. Furhtermore the varying data provided can be due to the fact that different trackers were used(some may not have heartrate monitors or some may not be able to track sleep), therefore not all the datasets will be used. Data was verified for integrity using Google Sheets.\n","\n","#### 3.5 Data Limitations <a class=\"anchor\" id=\"Prepare5\"></a>\n","* No metadata provided (we dont know the demographics of the users, location, lifestyle etc)\n","* Small sample size of 30 users ( can lead to sampling bias)\n","* Data collection period is limited (only one month), can't account for different activity trends throughtout the year\n","* Data is not current (was done in 2016)\n","\n"," With these limitations in mind we can begin to perform our analyis.\n"]},{"cell_type":"markdown","id":"4e12c63a","metadata":{"papermill":{"duration":0.020666,"end_time":"2022-08-04T20:31:16.327049","exception":false,"start_time":"2022-08-04T20:31:16.306383","status":"completed"},"tags":[]},"source":["# 4. Process <a class=\"anchor\" id=\"Process1\"></a>\n","\n","The R language is an accesibe and powerful tool so I will be doing the data processing,analysis and visualizations using the RStudio Cloud platform. Some datasets were imported into Google's BigQuery SQL sandbox environment to preview and query the data so I could better chose which datasets I would used in my analysis with the R language. \n","\n","#### 4.1 Installing packages and opening libraries  <a class=\"anchor\" id=\"Process2\"></a>"]},{"cell_type":"code","execution_count":1,"id":"0405dc47","metadata":{"execution":{"iopub.execute_input":"2022-08-04T20:31:16.371802Z","iopub.status.busy":"2022-08-04T20:31:16.369548Z","iopub.status.idle":"2022-08-04T20:31:18.614306Z","shell.execute_reply":"2022-08-04T20:31:18.612529Z"},"papermill":{"duration":2.270344,"end_time":"2022-08-04T20:31:18.617334","exception":false,"start_time":"2022-08-04T20:31:16.34699","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["── \u001b[1mAttaching packages\u001b[22m ─────────────────────────────────────── tidyverse 1.3.1 ──\n","\n","\u001b[32m✔\u001b[39m \u001b[34mggplot2\u001b[39m 3.3.6     \u001b[32m✔\u001b[39m \u001b[34mpurrr  \u001b[39m 0.3.4\n","\u001b[32m✔\u001b[39m \u001b[34mtibble \u001b[39m 3.1.7     \u001b[32m✔\u001b[39m \u001b[34mdplyr  \u001b[39m 1.0.9\n","\u001b[32m✔\u001b[39m \u001b[34mtidyr  \u001b[39m 1.2.0     \u001b[32m✔\u001b[39m \u001b[34mstringr\u001b[39m 1.4.0\n","\u001b[32m✔\u001b[39m \u001b[34mreadr  \u001b[39m 2.1.2     \u001b[32m✔\u001b[39m \u001b[34mforcats\u001b[39m 0.5.1\n","\n","── \u001b[1mConflicts\u001b[22m ────────────────────────────────────────── tidyverse_conflicts() ──\n","\u001b[31m✖\u001b[39m \u001b[34mdplyr\u001b[39m::\u001b[32mfilter()\u001b[39m masks \u001b[34mstats\u001b[39m::filter()\n","\u001b[31m✖\u001b[39m \u001b[34mdplyr\u001b[39m::\u001b[32mlag()\u001b[39m    masks \u001b[34mstats\u001b[39m::lag()\n","\n","\n","Attaching package: ‘lubridate’\n","\n","\n","The following objects are masked from ‘package:base’:\n","\n","    date, intersect, setdiff, union\n","\n","\n","\n","Attaching package: ‘janitor’\n","\n","\n","The following objects are masked from ‘package:stats’:\n","\n","    chisq.test, fisher.test\n","\n","\n","Loading required package: viridisLite\n","\n","Loading required package: grid\n","\n","Loading required package: futile.logger\n","\n","\n","Attaching package: ‘scales’\n","\n","\n","The following object is masked from ‘package:viridis’:\n","\n","    viridis_pal\n","\n","\n","The following object is masked from ‘package:purrr’:\n","\n","    discard\n","\n","\n","The following object is masked from ‘package:readr’:\n","\n","    col_factor\n","\n","\n"]}],"source":["#loading packages\n","library(tidyverse)\n","library(readr)\n","library(skimr)\n","library(lubridate)\n","library(janitor)\n","library(ggplot2)\n","library(ggrepel)\n","library(viridis)\n","library(VennDiagram)\n","library(treemap)\n","library(scales)\n"]},{"cell_type":"markdown","id":"02b808d5","metadata":{"papermill":{"duration":0.020721,"end_time":"2022-08-04T20:31:18.658783","exception":false,"start_time":"2022-08-04T20:31:18.638062","status":"completed"},"tags":[]},"source":["### 4.2 Importing Datasets <a class=\"anchor\" id=\"Process3\"></a>\n","Data used: **Daily Activity**,**Hourly Calories**, **Hourly Intensities**,**Hourly Steps**, **Sleep**,**Weight Log**, **Heartrate**."]},{"cell_type":"code","execution_count":2,"id":"dc071ceb","metadata":{"_kg_hide-output":true,"execution":{"iopub.execute_input":"2022-08-04T20:31:18.732364Z","iopub.status.busy":"2022-08-04T20:31:18.701807Z","iopub.status.idle":"2022-08-04T20:31:22.798885Z","shell.execute_reply":"2022-08-04T20:31:22.79625Z"},"papermill":{"duration":4.123522,"end_time":"2022-08-04T20:31:22.802605","exception":false,"start_time":"2022-08-04T20:31:18.679083","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["\u001b[1mRows: \u001b[22m\u001b[34m940\u001b[39m \u001b[1mColumns: \u001b[22m\u001b[34m15\u001b[39m\n","\u001b[36m──\u001b[39m \u001b[1mColumn specification\u001b[22m \u001b[36m────────────────────────────────────────────────────────\u001b[39m\n","\u001b[1mDelimiter:\u001b[22m \",\"\n","\u001b[31mchr\u001b[39m  (1): ActivityDate\n","\u001b[32mdbl\u001b[39m (14): Id, TotalSteps, TotalDistance, TrackerDistance, LoggedActivitiesDi...\n","\n","\u001b[36mℹ\u