 activity table\n","daily_activity$activity_date=as.POSIXct(daily_activity$activity_date,format =\"%m/%d/%Y\" , tz=Sys.timezone())\n","#for sleep table we only want the date not the time\n","sleep$sleep_day=as.POSIXct(sleep$sleep_day, format = \"%m/%d/%Y %I:%M:%S %p\",tz = Sys.timezone())  \n","#we want both date and time\n","hourly_calories$activity_hour=as.POSIXct(hourly_calories$activity_hour, format = \"%m/%d/%Y %I:%M:%S %p\",tz = Sys.timezone())\n","#we want both date and time\n","hourly_intensities$activity_hour=as.POSIXct(hourly_intensities$activity_hour, format = \"%m/%d/%Y %I:%M:%S %p\",tz = Sys.timezone())\n","#we want both date and time\n","hourly_steps$activity_hour=as.POSIXct(hourly_steps$activity_hour, format = \"%m/%d/%Y %I:%M:%S %p\",tz = Sys.timezone())\n","#we only want date\n","weight$date=as.POSIXct(weight$date,format =\"%m/%d/%Y\" , tz=Sys.timezone())\n","#we want both date and time\n","heartrate$time=as.POSIXct(heartrate$time,format =\"%m/%d/%Y %I:%M:%S %p\" , tz=Sys.timezone())"]},{"cell_type":"code","execution_count":9,"id":"172b2efd","metadata":{"execution":{"iopub.execute_input":"2022-08-04T20:31:37.772087Z","iopub.status.busy":"2022-08-04T20:31:37.77008Z","iopub.status.idle":"2022-08-04T20:32:36.525445Z","shell.execute_reply":"2022-08-04T20:32:36.523627Z"},"papermill":{"duration":58.785118,"end_time":"2022-08-04T20:32:36.527863","exception":false,"start_time":"2022-08-04T20:31:37.742745","status":"completed"},"tags":[]},"outputs":[],"source":["#adding a day of the week column to daily activity table\n","daily_activity <- daily_activity %>% \n","  mutate(day=weekdays(activity_date))\n","#reorder columns on daily activity table so that day is next to actvity_date\n","daily_activity <- daily_activity[,c(1,2,3,16,4:15)]\n","\n","#merge hourly tables into and split up activity hour into 2 date and time columns\n","#we use %A to display full weekdays\n","hourly_total <- hourly_calories %>% \n","  left_join(hourly_intensities,by=c(\"id\",\"activity_hour\")) %>% \n","  left_join(hourly_steps,by=c(\"id\",\"activity_hour\")) %>%\n","  separate(activity_hour,into = c(\"date\",\"time\"),sep = \" \") %>% \n","  mutate(day = format(ymd(date), format = '%A')) %>% \n","  mutate(time=format(parse_date_time(as.character(time), \"HMS\"), format = \"%H:%M\")) %>% \n","  mutate(date= as.POSIXct(date))\n","\n","#reorder columns so that day is next to date\n","hourly_total <- hourly_total[,c(1,2,8,3:7)]\n","\n","#separate time in heartrate df\n","heartrate <- heartrate %>% \n","  separate(time,into = c(\"date\",\"time_of_day\"),sep = \" \")"]},{"cell_type":"markdown","id":"8da0d8cb","metadata":{"papermill":{"duration":0.026994,"end_time":"2022-08-04T20:32:36.581697","exception":false,"start_time":"2022-08-04T20:32:36.554703","status":"completed"},"tags":[]},"source":["# 5. Analyze and Share <a class=\"anchor\" id=\"AnalyzeandShare1\"></a>"]},{"cell_type":"markdown","id":"4231d606","metadata":{"papermill":{"duration":0.031557,"end_time":"2022-08-04T20:32:36.63826","exception":false,"start_time":"2022-08-04T20:32:36.606703","status":"completed"},"tags":[]},"source":["### 5.1 Breaking down of Users using the fitness tracker features <a class=\"anchor\" id=\"AnalyzeandShare2\"></a>\n","The first step in this process is to see the number of unique IDs we have for each of the datasets we have imported. I'm trying to figure out if theres a discrepancy in this number. Analyzing this in this way will help me see how many users use the different features of their fitness tracker and thus I'll be able to apply it to the Bellabeat Time."]},{"cell_type":"code","execution_count":10,"id":"37f85b42","metadata":{"execution":{"iopub.execute_input":"2022-08-04T20:32:36.692922Z","iopub.status.busy":"2022-08-04T20:32:36.691219Z","iopub.status.idle":"2022-08-04T20:32:37.913373Z","shell.execute_reply":"2022-08-04T20:32:37.911398Z"},"papermill":{"duration":1.252376,"end_time":"2022-08-04T20:32:37.916237","exception":false,"start_time":"2022-08-04T20:32:36.663861","status":"completed"},"tags":[]},"outputs":[],"source":["#generate 4 unique id's so we can plot a venn diagram\n","step_id <- unique(daily_activity$id,incomparables = FALSE)\n","sleep_id <- unique(sleep$id,incomparables = FALSE)\n","heartrate_id <- unique(heartrate$id,incomparables = FALSE)\n","weight_id <- unique(weight$id,incomparables = FALSE)\n","\n","#plot venn diagram\n","venn_diagram <- venn.diagram(x=list(weight_id,heartrate_id,sleep_id,step_id),category.names = \n","  c(\"Weight Monitor\",\"Heartrate Monitor\",\"Sleep Monitor\",\"Step Counter\"),\n","  filename = \"tracker_features_venn.png\",output=TRUE,imagetype = \"png\",lwd=3,\n","  fill=c(\"darksalmon\",\"darkorange\",\"cyan\",\"darkorchid\"),cex = .9, fontface = \"bold\", fontfamily = \"Times\",\n","  cat.cex = .7, cat.fontface = \"bold\", cat.default.pos = \"outer\", cat.fontfamily = \"Times\")"]},{"attachments":{"45126be7-e6d1-46bc-8acb-0be946a1e2a7.png":{"image/png":""}},"cell_type":"markdown","id":"e84c91ef","metadata":{"papermill":{"duration":0.025181,"end_time":"2022-08-04T20:32:37.966439","exception":false,"start_time":"2022-08-04T20:32:37.941258","status":"completed"},"tags":[]},"source":["![tracker_features_venn.png](attachment:45126be7-e6d1-46bc-8acb-0be946a1e2a7.png)"]},{"cell_type":"markdown","id":"7e087523","metadata":{"papermill":{"duration":0.026814,"end_time":"2022-08-04T20:32:38.018052","exception":false,"start_time":"2022-08-04T20:32:37.991238","status":"completed"},"tags":[]},"source":["From the Venn Diagram we can see that there are **33** Unique ID's who use the step counter function of their tracker with and without other features. **33/33** 100% of users. This is because at the minimum, the tracker tracks your steps by default. \n","\n","**14** users use the heartrate monitor with the step monitor 14/33 **42.4%** of users \n","\n","**8** users use the weight monitor and step monitor 8/33 **24.2%** of users \n","\n","**24** users who use the sleep monitor  and step monitor 24/33 **72.7%** of users \n","\n","**3** users use all features 3/33 **9%** \n","\n","<u>Single Use</u>\n","\n","Only **6** users use only the step monitor 6/33 **18%**\n","\n","<u>Double Use</u>\n","\n","**9** users use both the sleep and step counter 9/33 **27%** \n","\n","**1** user uses weight and step counter 1/33 **3%**\n","\n","**1** user uses step counter and heartrate monitor 1/33 **3%** \n","\n","<u>Triple Use</u>\n","\n","**9** users sleep, step, and heartrate 9/33 **27%** \n","\n","**3** users weight, sleep, and step 3/33 **9%** \n","\n","**1** user weight, step, and heartrate 1/33 **3**% \n","\n","**0** users use all the other possible combinations \n"]},{"cell_type":"markdown","id":"5a242591","metadata":{"papermill":{"duration":0.025217,"end_time":"2022-08-04T20:32:38.068195","exception":false,"start_time":"2022-08-04T20:32:38.042978","status":"completed"},"tags":[]},"source":["Next I want to plot a graph that shows the user breakdown that uses each of these 4 features"]},{"cell_type":"code","execution_count":11,"id":"f829ffdb","metadata":{"_kg_hide-output":false,"execution":{"iopub.execute_input":"2022-08-04T20:32:38.121913Z","iopub.status.busy":"2022-08-04T20:32:38.120258Z","iopub.status.idle":"2022-08-04T20:32:38.519641Z","shell.execute_reply":"2022-08-04T20:32:38.517832Z"},"papermill":{"duration":0.429014,"end_time":"2022-08-04T20:32:38.521966","exception":false,"start_time":"2022-08-04T20:32:38.092952","status":"completed"},"tags":[]},"outputs":[{"data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAAA0gAAANICAIAAAByhViMAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdd3zU9f3A8c/lLpdJwghTQWUoKjgrFQU3VuvCQat1V62to3XVUVy1jtaf4qiz\ntmprbaXVuhW34h6otS5UsGpFRaZAdnK/P4LIkHBAkiMfns8/fOS+971v3t/L98jLG98kMplM\nAACg/cvL9QAAALQMYQcAEAlhBwAQCWEHABAJYQcAEAlhBwAQCWEHABAJYQcAEIl2FnYz3z8i\nkUgkEolzX5r6rSu8e/3WiURi8Ikvtc08x6/RIZFIvFtV3zbfbgVUfv7E4TtuXlGa7r7hr751\nhbp5rzXdpUvbwvgDBiQSiU3OmNBqM64qJpyxSSKR2PWpKbkepFW8/+dtEonENn9+fwVuW5zM\nSzRrdoPznAOsElK5HmAFXbzbYSd8dn/H1