to plot bar graph\n","id_dataframe <- data.frame(row_names,id_count)\n","  \n","#plotting bar graph to show feature vs user, had to use geom_col to be able to plot y axis\n","#mapping inside ggplot()\n","ggplot(data=id_dataframe,mapping=aes(x=row_names,y=id_count,fill=row_names)) + \n","  geom_col()+ \n","  labs(title = \"Number of Users using each Feature\",x=\"Feature\",y=\"Users\")+\n","  geom_text(aes(label=id_count),vjust=1.5)+\n","  guides(fill=\"none\")"]},{"cell_type":"markdown","id":"9cb19a9d","metadata":{"papermill":{"duration":0.025042,"end_time":"2022-08-04T20:32:38.573623","exception":false,"start_time":"2022-08-04T20:32:38.548581","status":"completed"},"tags":[]},"source":["To continue our analysis we need to merge daily activity and sleep dataframes"]},{"cell_type":"code","execution_count":12,"id":"5a34523b","metadata":{"execution":{"iopub.execute_input":"2022-08-04T20:32:38.627519Z","iopub.status.busy":"2022-08-04T20:32:38.625838Z","iopub.status.idle":"2022-08-04T20:32:38.651663Z","shell.execute_reply":"2022-08-04T20:32:38.649741Z"},"papermill":{"duration":0.054967,"end_time":"2022-08-04T20:32:38.654306","exception":false,"start_time":"2022-08-04T20:32:38.599339","status":"completed"},"tags":[]},"outputs":[],"source":["#merge daily activity and sleep df's\n","#but first make date column in sleep df the same as the one in daily activity\n","colnames(sleep)[2] <- \"activity_date\"\n","daily_sleep_activity <- merge(daily_activity,sleep, by=c(\"id\",\"activity_date\"))"]},{"cell_type":"markdown","id":"62801f12","metadata":{"papermill":{"duration":0.024912,"end_time":"2022-08-04T20:32:38.704417","exception":false,"start_time":"2022-08-04T20:32:38.679505","status":"completed"},"tags":[]},"source":["Next we'll categorize users according to how many days in the 1 month span they used their devices\n","\n","### 5.2 Usage Groups <a class=\"anchor\" id=\"AnalyzeandShare3\"></a>\n","* **Low Use** between 1 and 14 days\n","* **Moderate Use** between 15 and 21 day