user,xend=type_of_user,y=0,yend=users),color=\"gray70\",lwd=2)+\n","  geom_point(size=8.75,color=\"blue\")+\n","  geom_text(aes(label=percentage),color=\"white\",size=3.25)+\n","  labs(title = \"Daily Use Breakdown\",x=\"Type of User\",y=\"Number of users\")+\n","  coord_flip()"]},{"cell_type":"markdown","id":"c9ab623c","metadata":{"papermill":{"duration":0.027396,"end_time":"2022-08-04T20:32:40.129584","exception":false,"start_time":"2022-08-04T20:32:40.102188","status":"completed"},"tags":[]},"source":["We further analyze the data by activity throughout the week to see if there's a trend in the day of the week that sees users most active\n"]},{"cell_type":"code","execution_count":16,"id":"5973f5e2","metadata":{"execution":{"iopub.execute_input":"2022-08-04T20:32:40.187922Z","iopub.status.busy":"2022-08-04T20:32:40.186195Z","iopub.status.idle":"2022-08-04T20:32:40.691175Z","shell.execute_reply":"2022-08-04T20:32:40.689333Z"},"papermill":{"duration":0.537205,"end_time":"2022-08-04T20:32:40.693724","exception":false,"start_time":"2022-08-04T20:32:40.156519","status":"completed"},"tags":[]},"outputs":[{"data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAAA0gAAANICAIAAAByhViMAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdd0DU9f/A8dfnJhzzAHHixp0jR5lpQ9NcaOauxMKWX22oOTIzrbTpyFE5UvNX\nmJlmWlna0EqzclSao9Q0LRUBwROOcff5/XFGiIAocIdvn4+/js997v153V3Fs88NNF3XBQAA\nAFc+g68HAAAAQMkg7AAAABRB2AEAACiCsAMAAFAEYQcAAKAIwg4AAEARhB0AAIAiCDsAAABF\nEHY+oLvP1rFZNE0zGC0/ObJ8PY6PuZxHFk4dcdsNjcvZg80mS3B4peY3x0yYtTzFxVdnF0i7\ngMkaWLlG3V5xT6z5JdHX0wEAfEbjL09436mfh5drOttz+ZYl+78cFO3beXzIceTjW1r0+Skh\nXTNYKlStUbV8cOrJI3v/PKnrekh09/U/rWgZbPHsqbvPbt6y02Stel2LKN/OXBZomiYiUbVq\nW7VzW9JTk44nJLt0XTNYB7zwyTtP3OrL+QAAPsIZOx/4etSHIlKpS00R2T5xka/H8R09877W\n/X9KSK/Xe8Kvf5/++9De77//4beDx0/t3fRg24opv6/p3PapnH2z0/ffeOONHe+c78N5y5rV\nP//2+7+OnkhMObZ77ui+Jj3z3dHth3zwp6+nAwD4AGfsvM2dnVQ1MPLvTH3NXz/1qdrcqRs2\nnU678d/zUleVlENPhdZ83s/e4dSpzwMMWu6r3Jn/XBte/WdH5kt/pT5RJUhEss7usAReG1x1\nQsrhyT6atwzxnLHb7shsFmDOc9W21+9sMXSl2dbgr9O/ljf