s_sleep <- daily_sleep_activity %>%\n","  group_by(day) %>% \n","  summarise(average_steps=mean(total_steps),average_sleep=mean(total_minutes_asleep)) %>% \n","  mutate(hours=average_sleep/60)\n","weekday_steps_sleep<- weekday_steps_sleep%>% \n","  mutate(day=ordered(weekday_steps_sleep$day, \n","                     levels=c(\"Monday\", \"Tuesday\", \n","                              \"Wednesday\", \"Thursday\",\n","                              \"Friday\", \"Saturday\", \"Sunday\")))\n","  \n","#plot multiple bar plots on same page \n","#first one is average steps with a line for the recommended 7500 steps per day\n","#second one is average sleep with a aline for the recommended 8 hours of sleep per day\n","  ggplot(data=weekday_steps_sleep,mapping = aes(x=day,y=average_steps))+\n","  geom_col(fill=\"darkgreen\")+ \n","  geom_hline(yintercept = 7500) +\n","  labs(title = \"Average Steps per Day\",x=\"Day\",y=\"Steps\")+\n","  guides(fill=\"none\")+\n","  coord_flip()\n","ggplot(data=weekday_steps_sleep,mapping = aes(x=day,y=hours))+\n","  geom_col(fill=\"mediumpurple2\")+ \n","  geom_hline(yintercept = 8) +\n","  labs(title = \"Average Sleep per Day\",x=\"Day\",y=\"Hours Asleep\")+\n","  guides(fill=\"none\")+\n","  coord_flip()\n"]},{"cell_type":"markdown","id":"d4625f41","metadata":{"papermill":{"duration":0.028865,"end_time":"2022-08-04T20:32:40.752086","exception":false,"start_time":"2022-08-04T20:32:40.723221","status":"completed"},"tags":[]},"source":["From above we see that most users get their recommended steps in on days all besides Sunday. None of the users get the recommended 8 hours of sleep.\n","\n","Next we would like to know what time during the day users are most active."]},{"cell_type":"code","execution_count":17,"id":"ba164778","metadata":{"execution":{"iopub.execute_input":"2022-08-04T20:32:40.812447Z","iopub.status.busy":"2022-08-04T20:32:40.810807Z","iopub.status.idle":"2022-08-04T20:32:41.316029Z","shell.execute_reply":"2022-08-04T20:32:41.31