\",x=\"User Group\",\n","       y=\"Average Minutes\")+\n","  geom_text_repel(aes(x=usage,y=average_minutes,label=percentage),color=\"black\",size=3.25)+\n","  guides(fill=guide_legend(title=\"Level of activity\"))+\n","  coord_flip()"]},{"cell_type":"markdown","id":"f74da697","metadata":{"papermill":{"duration":0.032005,"end_time":"2022-08-04T20:32:43.456322","exception":false,"start_time":"2022-08-04T20:32:43.424317","status":"completed"},"tags":[]},"source":["fairly, lightly and very active are already levels of activity present in the dataset, but here there are shown broken down by Usage Group\n","\n","Next I wanted to see the distribution of the datasets I'm most interested in by creating some boxplots\n"]},{"cell_type":"code","execution_count":19,"id":"fe80966b","metadata":{"execution":{"iopub.execute_input":"2022-08-04T20:32:43.524392Z","iopub.status.busy":"2022-08-04T20:32:43.522171Z","iopub.status.idle":"2022-08-04T20:32:45.89344Z","shell.execute_reply":"2022-08-04T20:32:45.891462Z"},"papermill":{"duration":2.408416,"end_time":"2022-08-04T20:32:45.896656","exception":false,"start_time":"2022-08-04T20:32:43.48824","status":"completed"},"tags":[]},"outputs":[{"data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAAA0gAAANICAIAAAByhViMAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdd0ATZx8H8N9lQhLCVpHhQFRUFNziBHHvgXvUttZW696rdb1q3XuPqrVaR521\nWveoVuvEgasO3OwRsnP3/hFFZAkKBC7fz1/cc3fP87vjxG9uheE4jgAAAACg8BNYugAAAAAA\nyB0IdgAAAAA8gWAHAAAAwBMIdgAAAAA8gWAHAAAAwBMIdgAAAAA8gWAHAAAAwBMIdgAAAAA8\ngWBHJm3E+lkjmgRWdnVUikUSpXPxao3aTl66I8FUWF/dvNDbkWGYQ3Fa8+SV8f4Mw7Q4/TLX\nB0rT82B3O4Zh7mqMuT5QhsMBAABAGiJLF2Bhqog/gqqHXo7SMAJJMa9S1copEyMjrp05ePX0\ngaVLfzl6eVcNpcS8JMcmn79wXST1qlXd07I157UCsqUFpAwAAIBCxLqDHaf/sk63y1Ga8p0n\n71o2vmJRW3Nz7P1zE77usvrsgRb1J0XfmGNuNGru16tXT+k1OeHpNMtV/ClKhk7/uXyse3nH\nbC6f/S3Nac85kr6MPB0OAACAB6w62CU8mbbzpcrGMeTyb1PlAial3alsvRXHrvzjXPJG2Ny5\nzyeP9rCzYJGfz7lqm75VC1nPBWE4AACAQseq77GLC7tARPKifVOnOjOBxG16FRciOvE4KRdH\nZPXaQnvnXiqcLtLAWrqIT8Mma/PqFkAAAACLs+pgJ3GUEZHq5cqX+