],"source":["#plot boxplot to figure out distribution grouped by usage groups for total steps\n","ggplot(usage_2,aes(x=\"\",y=total_steps,fill=usage))+\n","  geom_boxplot()+\n","  scale_fill_viridis(discrete = TRUE, alpha=0.6)+\n","  geom_jitter(color=\"black\", size=0.4, alpha=0.9) +\n","  labs(title = \"Steps distribution\", subtitle = \"By Usage Group\",x=\"\",y=\"Steps\")+\n","  guides(fill=guide_legend(title=\"Usage Groups\"))+\n","  facet_wrap(~usage)\n","#plot boxplot to figure out distribution grouped by usage groups for calories\n","ggplot(usage_2,aes(x=\"\",y=calories,fill=usage))+\n","  geom_boxplot()+\n","  scale_fill_viridis(discrete = TRUE, alpha=0.6)+\n","  geom_jitter(color=\"black\", size=0.4, alpha=0.9) +\n","  labs(title = \"Calories distribution\", subtitle = \"By Usage Group\",x=\"\",y=\"Calories\")+\n","  guides(fill=guide_legend(title=\"Usage Groups\"))+\n","  facet_wrap(~usage)\n","\n","#plot boxplot to figure out distribution grouped by usage groups for total distance\n","ggplot(usage_2,aes(x=\"\",y=total_distance,fill=usage))+\n","  geom_boxplot()+\n","  scale_fill_viridis(discrete = TRUE, alpha=0.6)+\n","  geom_jitter(color=\"black\", size=0.4, alpha=0.9) +\n","  labs(title = \"Distance distribution\", subtitle = \"By Usage Group\",x=\"\",y=\"Distance\")+\n","  guides(fill=guide_legend(title=\"Usage Groups\"))+\n","  facet_wrap(~usage)\n","\n","#plot boxplot to figure out distribution grouped by usage groups for hours asleep\n","ggplot(usage_2,aes(x=\"\",y=total_minutes_asleep/60,fill=usage))+\n","  geom_boxplot()+\n","  scale_fill_viridis(discrete = TRUE, alpha=0.6)+\n","  geom_jitter(color=\"black\", size=0.4, alpha=0.9) +\n","  labs(title = \"Sleep distribution\", subtitle = \"By Usage Group\",x=\"\",y=\"Hours\")+\n","  guides(fill=guide_legend(title=\"Usage Groups\"))+\n","  facet_wrap(~usage)"]},{"cell_type":"markdown","id":"fd0d718d","metadata":{"papermill":{"duration":0.037537,"end_time":"2022-08-04T20:32:45.972588","exception":fals