8dTlA/O5vS8AAAC+CBo7AAAAAAAeAfPY\nAQAAAADwCGjsAAAAAAB4BDR2AAAAAAA8Aho7AAAAAAAeAY0dAAAAAACPgMYOAAAAAIBHQGMH\nAAAAAMAjoLEDAAAAAOAR0NgBAAAAAPCI/wO/9qHmrm/xxAAAAABJRU5ErkJggg=="},"metadata":{"image/png":{"height":420,"width":420}},"output_type":"display_data"}],"source":["#active minutes calculations\n","#create new dataframe that has variables i need grouped\n","active_2 <- usage_2 %>% \n","  group_by(day,usage) %>% \n","  summarise(very_active=round(mean(very_active_minutes),2),\n","            fairly_active=round(mean(fairly_active_minutes),2),\n","            lightly_active=round(mean(lightly_active_minutes),2)) \n","\n","\n","\n","#make this same dataframe into a long dataframe so i can plot it\n","active_2 <-pivot_longer(active_2,3:5,names_to = \"activity\",\n","                                   values_to = \"average_minutes\")\n","#level order to make days appear in order\n","level_order <- c(\"Monday\", \"Tuesday\", \n","                 \"Wednesday\", \"Thursday\",\n","                 \"Friday\", \"Saturday\", \"Sunday\")\n","#plot facet grid for average active minutes\n","ggplot(active_2,aes(x=factor(day,level=level_order),y=average_minutes,fill=usage))+\n","  geom_col()+\n","  scale_fill_viridis(discrete = TRUE, alpha=0.85)+\n","  theme(axis.text.x = element_text(size = 11, angle = 60, hjust = 1, vjust = 1))+\n","  labs(title = \"Average Active Minutes\",subtitle = \"by Usage Group and Activity Level\",\n","       x=\"Days\",y=\"Average Active Minutes\")+\n","  guides(fill=guide_legend(title=\"Usage Groups\"))+\n","  facet_grid(activity~usage,scales = \"free\")"]},{"cell_type":"code","execution_count":21,"id":"32cfdae0","metadata":{"execution":{"iopub.execute_input":"2022-08-04T20:32:46.874491Z","iopub.status.busy":"2022-08-04T20:32:46.872408Z","iopub.status.idle":"2022-08-04T20:32:47.406389Z","shell.execute_reply":"2022-08-04T20:32:47.40439Z"},"papermill":{"duration":0.578384,"end_time":"2022-08-04T20:32:47.409298","exception":false,"start_time":"2022-08-0