r_groups, by=\"id\",\"usage\") %>% \n","  select(-days_in_use)\n","\n","hourly_by_usage %>% \n","  mutate(day=fct_relevel(day,\n","                         c(\"Monday\", \"Tuesday\", \"Wednesday\", \"Thursday\", \"Friday\", \n","                           \"Saturday\",\"Sunday\"))) %>% \n","  group_by(time,day,usage) %>% \n","  summarise(steps=round(mean(step_total),2)) %>% \n","  ggplot(aes(x=time,y=steps,fill=steps))+\n","  geom_col()+\n","  scale_fill_viridis(discrete = FALSE, alpha=1)+\n","  labs(title = \"Average Hourly Steps\", \n","       subtitle=\"by Day,Usage Group\",x=\"Hour of the Day\", y=\"Average Steps\") +\n","  guides(fill=guide_legend(title=\"Scale\"))+\n","  coord_flip()+\n","  theme(axis.text.x = element_text(size=6), axis.text.y = element_text(size=5))+\n","  facet_grid(usage~day)\n","\n","#use pipeline to plot heatmap of avg hourly steps\n","hourly_by_usage %>% \n","  mutate(day=fct_relevel(day,\n","                         c(\"Monday\",\"Tuesday\",\"Wednesday\",\"Thursday\",\"Friday\",\n","                           \"Saturday\",\"Sunday\"))) %>% \n","  group_by(time,day,usage) %>% \n","  summarise(steps=round(mean(step_total),2)) %>%\n","  ggplot(aes(x=time,y=day,fill=steps)) +\n","  geom_tile()+\n","  scale_fill_viridis(name=\"Scale\",option=\"H\")+\n","  geom_text(aes(label = round(steps, digits = 0)), color = \"black\", size = 2.9)+\n","  labs(title = \"Average Hourly Steps\", \n","       subtitle=\"by Day,Usage Group\",x=\"Hour of the Day\", y=\"Day\")+\n","  theme(axis.text.x = element_text(size = 8, angle = 60, hjust = 1, vjust = 1),\n","        axis.text.y = element_text(size=5))+\n","  facet_wrap(~usage,ncol = 1)"]},{"cell_type":"markdown","id":"683cd250","metadata":{"papermill":{"duration":0.050545,"end_time":"2022-08-04T20:32:49.932332","exception":false,"start_time":"2022-08-04T20:32:49.881787","status":"completed"},"tags":[]},"source":["### Hourly Calories Burned"]},{"cell_type":"code","execution_count":23,"id":"89139348","metadat