airly_active_minutes+lightly_active_minutes+\n","           sedentary_minutes) %>% \n","  mutate(percentage_worn=round((total_minutes_worn/1440)*100,2)) %>% \n","  mutate(worn=case_when(\n","    percentage_worn==100~ \"All day\",\n","    percentage_worn<100 & percentage_worn>=50~ \"More than half a day\",\n","    percentage_worn<50 &percentage_worn>=0~ \"Less than half a day\"\n","  )) %>% \n","  select(id,activity_date,total_minutes_worn,percentage_worn,worn,usage)\n","#get the total of number of people that wear their tracker half a day or longer\n","worn_time2 <- worn_time %>% \n","  group_by(id,worn) %>% \n","  summarise(total=n()) %>% \n","  group_by(worn) %>% \n","  tally() %>% \n","  mutate(totals=sum(n)) %>% \n","  group_by(worn) %>% \n","  mutate(total_percent=n/totals) %>% \n","  mutate(labels=scales::percent(total_percent))\n","\n","#plot bar graph showing breakdown of users that wore their tracker in a day\n","ggplot(worn_time2,aes(x=worn,y=n,fill=worn))+\n","  geom_col()+\n","  scale_fill_viridis(discrete=T,alpha = .8)+\n","  coord_flip()+\n","  theme_minimal()+\n","  labs(title = \"Numbers of users wearing their tracker in a day\",\n","       subtitle = \"by Tendency to wear the device\",\n","       x=\"Tendancy\",y=\"Number of Users\")+\n","  geom_text(aes(label=labels),vjust=1,hjust=1)+\n","  guides(fill=\"none\")"]},{"cell_type":"markdown","id":"bfea26cb","metadata":{"papermill":{"duration":0.06486,"end_time":"2022-08-04T20:32:59.061206","exception":false,"start_time":"2022-08-04T20:32:58.996346","status":"completed"},"tags":[]},"source":["Same analyis but broken down by Usage Groups"]},{"cell_type":"code","execution_count":28,"id":"2e46fd8f","metadata":{"execution":{"iopub.execute_input":"2022-08-04T20:32:59.23462Z","iopub.status.busy":"2022-08-04T20:32:59.233015Z","iopub.status.idle":"2022-08-04T20:32:59.778996Z","shell.execute_reply":"2022-08-04T20:32:59.7771Z"},"papermill":{"duration":0.653219,"end_time":"2022-08-04T20:32:59.781628","exception":