age group thruought week\n","ggplot(intensity2,aes(x=factor(day,level=level_order),y=intensity,fill=usage))+\n","  geom_col()+\n","  scale_fill_viridis(discrete=T,alpha = .8,option = \"E\")+\n","  coord_flip()+\n","  theme_minimal()+\n","  labs(title = \"Intensity throughout the week\",\n","       subtitle = \"by Usage Group\",\n","       x=\"Day\",y=\"Intensity\")+\n","  guides(fill=\"none\")+\n","  facet_wrap(~usage)"]},{"cell_type":"markdown","id":"8b37a6c2","metadata":{"papermill":{"duration":0.066737,"end_time":"2022-08-04T20:33:00.700199","exception":false,"start_time":"2022-08-04T20:33:00.633462","status":"completed"},"tags":[]},"source":["# 6. Act <a class=\"anchor\" id=\"Act1\"></a>\n","\n","Analyzing the data would be nothing without drawing insights and conclusions based on our analysis. To do this we go back to our original business task which states:\n","\n","*Analyze how people use their smart fitness devices so that Bellabeat can learn and apply these trends to their own customers as well as make data driven decisions so they can apply them to their marketing strategy*\n","\n","With the 3 Questions guiding this analysis being:\n","1. What are some trends in smart device usage?\n","2. How could these trends apply to Bellabeat customers?\n","3. How could these trends help influence Bellabeat marketing strategy?\n"]},{"cell_type":"markdown","id":"33e045f9","metadata":{"papermill":{"duration":0.067187,"end_time":"2022-08-04T20:33:00.833575","exception":false,"start_time":"2022-08-04T20:33:00.766388","status":"completed"},"tags":[]},"source":["### 6.1 Discussion on trends <a class=\"anchor\" id=\"Act2\"></a>\n","\n","From our analysis we see that out of the 4 possible features offered( Weight Monitor, Sleep Monitor, Step Counter, Heartrate Monitor) only 9% of users take advantage of all features. 72.7% of users use the combination of step counter and sleep monitor, by far the most used combination. These 2 features are in line with what the Bellabeat Time offers. We can infer from the current market offerings that fitness trackers can only track your weight if it is done thru user input, thus the weight monitor and step counter combination is not a surprised coming in at the second least used(24.2%). The second most used combination is the step  counter and heartrate monitor at 42.4%. However, the Time does not have a heartrate monitor offering.  \n","\n","Further breaking down our analysis by Usage Group allowed us to see more trends in the data. An overwhelming 73% of users fall into the High Use category (usage between 22 and 31 days). While moderate use doesn’t even crack 25% of users. The data points that people that use fitness trackers take advantage of their features by using them for the most of the month. When broken down by the type of activity(sedentary, active, highly active) we see again that most users that use these trackers are being 58% of the time active, while only 21% of them are sedentary. However we also see that all users get their recommended amount of 7500 steps each day of the week, bar Sunday. This means that even the more sedentary users get their steps in. This trend can be seen in the average active minutes by user group, as even the low usage group is at least lightly active 87.55% of the day. \n","\n","Sleep analysis indicates however that no user gets the recommended 8 hours of sleep a day. However the high use usage is the most consistent at getting the same amount of sleep per day, as the plot no major fluctuations in time asleep. The high use group is also most consistent by average active minutes per day. \n","\n","Breaking down our analysis by hour lets us glimpse more trends. From the intensity heat mat we can see that moderate users are constant in the steps they take throughout the  day, while high use users are up earlier and are most active between 4-7pm. The data from the hourly calories analysis gives us a surprise result, as we see that low use users burn more calories later in the day than do moderate users. They’re not as active but it can be inferred that they are more consistent. The insight gain from the intensity heat map is almost identical to the  active steps  heatmap, this makes sense because when see the correlation plot between the intensity and steps of a user we see a positive correlation. Furthermore we see positive correlations between calories burned and steps taken as week as intensity and calories burned. These trends are aligned with what science tells us. \n","\n","Finally, in the tendency to wear their device throughout the day we see that over 66% people wear their device more than half the day as opposed to 34% wearing them less than half the day. We also see the high usage group being the ones that wear their devices more than half the day. Perhaps the users wearing them less than half the day are the users that are not tracking their sleep. information would need to be given in order to make this analysis. We also see that the intensity throughout the week varies between user groups but is constant for each. \n","\n","It will be remissed to say that this is a very limited analysis in scope. Very few insights could be extracted because we don't have adequate and sufficient data at our disposal. Demographic qualities such as gender, physical activity type,location would all serve us in better extracting meaningful insights fro the data."]},{"cell_type":"markdown","id":"52595ca6","metadata":{"papermill":{"duration":0.068668,"end_time":"2022-08-04T20:33:00.978637","exception":false,"start_time":"2022-08-04T20:33:00.909969","status":"completed"},"tags":[]},"source":["### 6.2 Recommendations <a class=\"anchor\" id=\"Act3\"></a>\n","\n","Bellabeat markets the Time as \"effortlessly blend into your everyday as a luxury hybrid wellness watch, suitable for any occasion\", and it is meant to look like a timeless watch instead of a tracker with a screen(you need the app to view your stats)\n","\n","1. The Time currently doesn't offer a heartrate monitor, however the data points out that most users are using the heartrate monitor feature of their fitness trackers. Perhaps a small but visible circle that displays the color of your heartrate would be a good addition that doesnt distrack from the timeless look of the watch.This would allow for the user to be able to check their current heartrate in the app if they so wish.By just having the color display users can still use their watch on a daily basis and only check the app when they notice a change in the color.\n","\n","2. The High Usage group was the group that I was able to gain the most trends from as they were by far the most consistent group. However since Bellabeat is more of an all around wellness app than a pure fitness brand like FitBit, they could start marketing more towards the most active users by offering more functional features but still staying true to their core offering and thus offering a unique product in the market. \n","\n","3. More marketing should be focused on getting a good night's sleep. The data showed that an overwhelmingly amount of users were not getting a good night sleep, across all usage groups. A marketing stragety designed to target sleep wellness by providing more stats and insights into a good night's sleep would be my recommendation.Furthermore providing sleep cycle and sleep wind down(meditation etc) features can help in increasing the amount of sleep users get.\n","\n","4. Women specific data is needed to better cater Bellabeat to their consumer base. Conducting studies that show how women use their devices for women specific needs(menstrual health) can better give us insights into how best to reach that consumer.\n","\n","5. Target near 100% use of device throughout the day. In order to increase this tendency I would recommend adding a socialization and rewards/virutal badges system. By adding these challenges throughout the day people can be more inclined to keep wearing their device if they're receiving feedback."]}],"metadata":{"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"4.0.5"},"papermill":{"default_parameters":{},"duration":109.346345,"end_time":"2022-08-04T20:33:01.269922","environment_variables":{},"exception":null,"input_path":"__notebook__.ipynb","output_path":"__notebook__.ipynb","parameters":{},"start_time":"2022-08-04T20:31:11.923577","version":"2.3.4"}},"nbformat":4,"nbformat_minor":5}